import React from "react";

export default function Travel(props){


    return(
        <div>
            <div><i class="fa-light fa-location-dot"></i> {props.location} <a href={props.googleurlmap}>voir dans le map</a> </div>

            <div>{props.startdate} {props.enddate} </div>


        </div>
    )
}
